package service

import (
	"encoding/base64"
)

func (t *templateService) fileDirectoryPublic() {
	t.files = append(t.files, &templateFile{
		name:  "public/doc/openapi-spec/index.html",
		parse: true,
		body: `
<!DOCTYPE html>
<html lang="en">
  <head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <title>gRPC-Kit</title>
    <style>
      body {
        margin: 0;
        padding: 0;
      }
    </style>
  </head>

  <body>
    <redoc spec-url='/openapi-spec/api/{{ .Global.ProductCode }}/{{ .Global.ShortName }}/{{ .Template.Service.APIVersion }}/microservice.swagger.json'></redoc>
    <script src="./redoc.standalone.js"> </script>
  </body>
</html>
`,
	})

	// 内容包含特殊字符，使用base64编码保存在转换
	tmplBase64 := `
`

	tmplBody, err := base64.StdEncoding.DecodeString(tmplBase64)
	if err != nil {
		tmplBody = []byte("base64 decode string error")
	}
	t.files = append(t.files, &templateFile{
		name: "public/doc/openapi-spec/redoc.standalone.js",
		body: string(tmplBody),
	})

	t.files = append(t.files, &templateFile{
		name:  "public/doc/embed.go",
		parse: true,
		body: `
// Code generated by "grpc-kit-cli/{{ .Global.ReleaseVersion }}". DO NOT EDIT.

package doc

import (
	"embed"
)

//go:embed openapi-spec/*
var Assets embed.FS
`,
	})
}
